	add("triangle", "{\"term\":\"triangle\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027triangle\u0027 from Latin \u0027triangulum\u0027 noun use of neuter of adjective \u0027triangulus\u0027 (three-cornered, having three angles) from \u0027trēs\u0027 (three) + \u0027angulus\u0027 (corner, angle)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A polygon with three sides and three angles\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A percussion instrument made by forming a metal rod into a triangular shape which is open at one angle. It is suspended from a string and hit with a metal bar to make a resonant sound\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A triangular piece of equipment used for gathering the balls into the formation required by the game being played\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A love triangle\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, Neil McDonald, \u0027Quadrant\u0027, November 2009, No. 461 (Volume LIII, Number 11), Quadrant Magazine Limited, page 104\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"One of the writers\u0027 most pleasing inventions was to treat the \u0027\u0027triangle\u0027\u0027 love story as comedy\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The structure of systems composed with three interrelated objects\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A draughtsman\u0027s square in the form of a right-angled triangle\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A frame formed of three poles stuck in the ground and united at the top, to which soldiers were bound when undergoing corporal punishment\", \"priority\":9}]}, \"synonyms\":{\"list\":[{\"text\":\"trigon\", \"synonymQualifier\":\"RARE\"}]}}");

