	add("tribadism", "{\"term\":\"tribadism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|tribade|ism|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Lesbianism\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, Emily Wilson, \u0026quot;Lady of Lesbos\u0026quot;, \u0027The Guardian\u0027, 2 Feb 04\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Things changed when Théophile Gautier made \u0027\u0027tribadism\u0027\u0027 a fashionable feature of French decadence, and Baudelaire reminded the world that it all started on Lesbos\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Specifically, a form of lesbian intercourse involving the rubbing together of two partners\u0027 vulvae\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1908\u0027\u0027, \u0027Medical Council: Volume 13\u0027 (page 12\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The Lesbian is the analogue among women of Persian love among men, and this perversion takes place in two ways, either by friction of the two female bodies, known as \u0027\u0027tribadism\u0027\u0027, or by the tongue, designated as cunnilinguism\", \"priority\":6}]}, \"synonyms\":{}}");

