	add("tribulation", "{\"term\":\"tribulation\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\"], \"text\":\"Middle english (1100-1500) \u0027tribulation\u0027 from Old french (842-ca. 1400) \u0027tribulacion\u0027 from \u0027tribulatio\u0027 () from \u0027tribulare\u0027 () from \u0027tribulum\u0027 () from \u0027terere\u0027 () see trite.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any adversity; a trying period or event\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1535\u0027\u0027, w:Thomas Thomas More, \u0027Dialogue of Comfort Against Tribulation\u0027, ch. 6\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"For the blessed apostle himself in his sore \u0027\u0027tribulation\u0027\u0027, praying thrice unto God to take it away from him, was answered again by God (in a manner) that he was but a fool in asking that request, but that the help of God\u0027s grace in that \u0027\u0027tribulation\u0027\u0027 to strengthen him was far better for him than to take that \u0027\u0027tribulation\u0027\u0027 from him\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1847\u0027\u0027, w:Herman Herman Melville, \u0027Omoo\u0027, ch. 11\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Baltimore\u0027s \u0027\u0027tribulations\u0027\u0027 were indeed sore; there was no peace for him day nor night\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1944\u0027\u0027 June 27, q:Herbert Herbert Hoover, Speech in Chicago, Illinois to the 23rd Republican National Convention\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"It is youth who must inherit the \u0027\u0027tribulation\u0027\u0027, the sorrow and the triumphs that are the aftermath of war\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027 Sept. 24, w:Richard Richard Corliss, \u0026quot;[http://content.time.com/time/arts/article/0,8599,1925955,00.html \u0027Kristina\u0027: A New Musical from the ABBA Guys],\u0026quot; \u0027New York Times\u0027 \u0026lt;small\u0026gt;(retrieved 12 March 2014)\u0026lt;/small\u0026gt\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Essentially stoic, passive characters, Kristina and the others triumph by surviving — by outliving their plagues and \u0027\u0027tribulations\", \"priority\":9}]}, \"synonyms\":{}}");

	add("tribunal", "{\"term\":\"tribunal\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027tribunal\u0027 from Latin {{m|la|tribūnal||tribunal}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An assembly including one or more judges to conduct judicial business; a court of law\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A kind of village hall used to transact business, to quarter troops and travellers, and to confine prisoners\", \"priority\":2}]}, \"synonyms\":{}}");

	add("tribute", "{\"term\":\"tribute\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Middle english (1100-1500) from Old french (842-ca. 1400) \u0027tribut\u0027 from Latin \u0027tributum\u0027 (tribute, literally \u0027a thing contributed or paid\u0027) neuter of \u0027\u0027 past participle of \u0027tribuere\u0027 () usually derived, from \u0027tribus\u0027 () see tribe.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An acknowledgment of gratitude, respect or admiration; an accompanying gift\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Please accept this as a \u0027\u0027tribute\u0027\u0027 of our thanks\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"the passing \u0027\u0027tribute\u0027\u0027 of a sig\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A payment made by one nation to another in submission\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The Ancient Romans made their conquered countries pay \u0027\u0027tribute\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Extortion; protection money\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A payment made by a feudal vassal to his lord\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A certain proportion of the mined ore, or of its value, given to the miner as payment\", \"priority\":8}]}, \"synonyms\":{}}");

