	add("tricesimation", "{\"term\":\"tricesimation\", \"etymology\":{\"influencers\":[], \"languages\":[\"German\", \"English\", \"Latin\"], \"text\":\"From the German \u0027tricesimation\u0027 ultimately from the Latin \u0027trīcēsimus\u0027 (thirtieth)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A one- introduced in the w:Duchy of Duchy of Württemberg in 1691\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1995\u0027\u0027, Peter H. Wilson, \u0027War, State and Society in Württemberg, 1677–1793\u0027, \u0026lt;span class\u003d\u0026quot;plainlinks\u0026quot;\u0026gt;[http://books.google.co.uk/books?id\u003dVb1RaxEawiwC\u0026amp;pg\u003dPA117\u0026amp;dq\u003d%22This+was+the+Tricesimation%22\u0026amp;hl\u003den\u0026amp;ei\u003dNiQ7ToDxJsfysganmYUU\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;resnum\u003d1\u0026amp;ved\u003d0CCoQ6AEwA\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22This%20was%20the%20Tricesimation%22\u0026amp;f\u003dfalse page 117]\u0026lt;/span\u0026gt\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"On 25 June a fifth emergency tax was introduced to cover the increased expense. This was the \u0027\u0027\u0027Tricesimation\u0027\u0027\u0027 which was the ducal answer to the estates’ Accise. For the first time the duke had a tax that both approximated to the level of economic production and above all was under his control.⁷\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"⁷⁷ The \u0027\u0027Tricesimation\u0027\u0027 was a one-thirtieth purchase and produce tax collected by ducal officials…. No records of the level collected survive, but around 1700 the \u0027\u0027Tricesimation\u0027\u0027 brought in about 100,000fl. annually\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, Paul Warde, \u0027Ecology, Economy and State Formation in Early Modern Germany\u0027, \u0026lt;span class\u003d\u0026quot;plainlinks\u0026quot;\u0026gt;[http://books.google.co.uk/books?id\u003dOoWFbdNcVzEC\u0026amp;pg\u003dPA148\u0026amp;dq\u003d%2Btricesimation\u0026amp;hl\u003den\u0026amp;ei\u003dKik7Tr3ANsfKtAbP17Em\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;resnum\u003d2\u0026amp;ved\u003d0CDIQ6AEwA\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%2Btricesimation\u0026amp;f\u003dfalse page 148]\u0026lt;/span\u0026gt\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Between 1691 and 1724 cultivators were subject to the \u0027\u0027\u0027Tricesimation\u0027\u0027\u0027, a tax of one-thirtieth of grain and wine produced\", \"priority\":8}]}, \"synonyms\":{}}");

