	add("trichlorofluoromethane", "{\"term\":\"trichlorofluoromethane\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|tri-|chloro-|fluoro-|methane|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A chlorofluorocarbon, CFCl\u0026lt;sub\u0026gt;3\u0026lt;/sub\u0026gt;, formerly used as a refrigerant but retired because of harmful effects on the ozone layer\", \"priority\":1}]}, \"synonyms\":{}}");

	add("trichology", "{\"term\":\"trichology\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027\u0027 (τριχ) root of \u0027lang\u003dgrc|θρίξ\u0027 () + \u0027-λογια\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The science or study of hair\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1993\u0027\u0027, Will Self, \u0027My Idea of Fun\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"They had spread themselves beneath the oaks and chestnuts and planted the green banks with tussocks of crocuses; it was more like some exercise in \u0027\u0027trichology\u0027\u0027 than horticulture\", \"priority\":3}]}, \"synonyms\":{}}");

	add("trichomania", "{\"term\":\"trichomania\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) θρίξ\u0027 (hair) (stem \u0027trikh-\u0027) and \u0027μανία\u0027 (madness)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A mania or passion for long hair; hair-fetishism\", \"priority\":1}]}, \"synonyms\":{}}");

	add("trichomaniac", "{\"term\":\"trichomaniac\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|tricho|maniac|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One with a mania or passion for hair\", \"priority\":1}]}, \"synonyms\":{}}");

	add("trichophilia", "{\"term\":\"trichophilia\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From Greek \u0027\u0027\u0027tricho\u0027\u0027\u0027, \u0026quot;hair\u0026quot; + Greek \u0027\u0027\u0027philia\u0027\u0027\u0027, \u0026quot;love\u0026quot;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a paraphilia in which one is sexually aroused by, or extremely fond of, human hai\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"any hair-related fetish\", \"priority\":2}]}, \"synonyms\":{}}");

	add("trichophyte", "{\"term\":\"trichophyte\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|tricho|phyte|t1\u003dhair|t2\u003dplant|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any organism of the fungus genus Trichophyton\", \"priority\":1}]}, \"synonyms\":{}}");

	add("trichording", "{\"term\":\"trichording\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|triple|coordinate|lang\u003den}}, referring to simultaneous movement along 3 orthogonal axes\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Moving in multiple directions, or about multiple axes\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1997\u0027\u0027, \u0026quot;micnet\u0026quot;, \u0027SpaceOrb Debate (was: auto-levelling)\u0027 (on newsgroup \u0027alt.games.descent\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"I know nothing about elite players but I belive \u0027\u0027trichording\u0027\u0027 works at its best in dogfights\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2002\u0027\u0027, \u0026quot;Samus\u0026quot;, \u0027Releasing the 1.5 patch unofficially...\u0027 (on Internet newsgroup \u0027alt.games.descent\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"In order to know when someone\u0027s cheating, one has to know everything about the weapons in Descent 3. One must know reload rates, relative shield damage, and physics (to a small degree). One should also know about ship physics for each ship, and of course know about \u0027\u0027trichording\u0027\u0027 and know what it looks like when a certain ship is trichording\", \"priority\":5}]}, \"synonyms\":{}}");

	add("trichotillomania", "{\"term\":\"trichotillomania\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027θρίξ\u0027 (hair) (genitive: \u0027τριχός\u0027 + \u0027τίλλω\u0027 (i pull out, pluck) + \u0027μανία\u0027 (madness)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a medical disorder in which the patient compulsively pulls his/her own hair out\", \"priority\":1}]}, \"synonyms\":{}}");

	add("trichotomy", "{\"term\":\"trichotomy\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Division or separation into three groups or pieces\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"the following property of an order relation (e.g., \u0026quot;less than\u0026quot;): for any two elements (of a given algebraic structure) there are exactly three possibilities: either the first element is less than the second one, the second element is less than the first one, or the two elements are equal\", \"priority\":2}]}, \"synonyms\":{}}");

	add("trichroism", "{\"term\":\"trichroism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The property of some optically anisotropic crystals of transmitting different colours of light in three different spatial directions\", \"priority\":1}]}, \"synonyms\":{}}");

	add("tricine", "{\"term\":\"tricine\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{blend|tris|glycine|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An organic compound used in buffer solutions\", \"priority\":1}]}, \"synonyms\":{}}");

	add("trickery", "{\"term\":\"trickery\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{rfe|lang\u003den|Old French \u0027tricherie\u0027 }}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Deception or underhanded behavior\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1852\u0027\u0027, w:Charles Charles Dickens, \u0027Bleak House\u0027, ch. 1\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"In \u0027\u0027trickery\u0027\u0027, evasion, procrastination, spoliation, botheration, under false pretences of all sorts, there are influences that can never come to good\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The art of dress dressing up; imposture\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Artifice; the use of one or more stratagems\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"An instance of deception, underhanded behavior, dressing up, imposture, artifice, etc\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"1809\u0027\u0027, w:Washington Washington Irving, \u0027Knickerbocker\u0027s History of New York\u0027, ch. 47\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"H]e did not wrap his rugged subject in silks and ermines, and other sickly \u0027\u0027trickeries\u0027\u0027 of phrase\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"1898\u0027\u0027, w:Bret Bret Harte, \u0026quot;See UP\u0026quot; in \u0027Stories in Light and Shadow\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"The miners found diversions even in his alleged frauds and \u0027\u0027trickeries\u0027\u0027 . . . and were fond of relating with great gusto his evasion of the Foreign Miners\u0027 Tax\", \"priority\":10}]}, \"synonyms\":{}}");

	add("trickle", "{\"term\":\"trickle\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Originally of tears; from \u0027\u0027 frequentative of \u0027strike\u0027 by elision (probably because \u0027tears trickle\u0027 is easier to pronounce than \u0027tears strickle\u0027).\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A very thin river\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The brook had shrunk to a mere \u0027\u0027trickle\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A very thin flow; the act of trickling\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The tap of the washbasin in my bedroom is leaking and the \u0027\u0027trickle\u0027\u0027 drives me mad at night\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"James Bryc\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The streams that run south and east from the mountains to the coast are short and rapid torrents after a storm, but at other times dwindle to feeble \u0027\u0027trickles\u0027\u0027 of mud\", \"priority\":6}]}, \"synonyms\":{}}");

	add("triclavianism", "{\"term\":\"triclavianism\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"Latin\"], \"text\":\"tri- + Latin \u0027clavus\u0027 (nail) + -ian + -ism (G. S. Faber, 1838)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The belief that three nails were used in the crucifixion of Jesus Christ\", \"priority\":1}]}, \"synonyms\":{}}");

	add("triclosan", "{\"term\":\"triclosan\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A potent wide-spectrum antibacterial and antifungal agent, molecular formula C\u0026lt;sub\u0026gt;12\u0026lt;/sub\u0026gt;H\u0026lt;sub\u0026gt;7\u0026lt;/sub\u0026gt;C\u0026lt;sub\u0026gt;l3\u0026lt;/sub\u0026gt;O\u0026lt;sub\u0026gt;2\u0026lt;/sub\u0026gt\", \"priority\":1}]}, \"synonyms\":{}}");

