	add("tricolpates", "{\"term\":\"tricolpates\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{rfe|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"in the APG system a name for one of the major clades, comprising most of the former dicotyledons. This group has tricolpate pollen or a type derived from this. Not in use in the singular\", \"priority\":1}]}, \"synonyms\":{}}");

	add("tricot", "{\"term\":\"tricot\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"From the French verb \u0027tricoter\u0027 \u0026quot;to knit\u0026quot;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A soft, knit fabric\", \"priority\":1}]}, \"synonyms\":{}}");

	add("tricriterion", "{\"term\":\"tricriterion\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|tri|criterion|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of three criteria in the same system\", \"priority\":1}]}, \"synonyms\":{}}");

	add("tricrystal", "{\"term\":\"tricrystal\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|tri|crystal|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A (or similar device) incorporating a junction of three\", \"priority\":1}]}, \"synonyms\":{}}");

