	add("tridecyl", "{\"term\":\"tridecyl\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|tri|decyl|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The univalent radical derived from tridecane\", \"priority\":1}]}, \"synonyms\":{}}");

	add("trier", "{\"term\":\"trier\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|try|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who tries; one who makes experiments or examines anything by a test or standard\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An instrument used for sampling something\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, Stephanie Clark, ‎Michael Costello, ‎Floyd Bodyfelt, \u0027The Sensory Evaluation of Dairy Products\u0027 (page 145\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The judge should grasp the butter \u0027\u0027trier\u0027\u0027 firmly in hand and insert the sampling device as near as possible to the center of the butter sample\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"One who tries judicially\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A person appointed by law to try challenges of jurors; a trior\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"That which tries or approves; a test\", \"priority\":7}]}, \"synonyms\":{}}");

	add("triene", "{\"term\":\"triene\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{confix|tri|ene|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any alkene that has three double bonds\", \"priority\":1}]}, \"synonyms\":{}}");

	add("triethylenediamine", "{\"term\":\"triethylenediamine\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|triethylene|diamine|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The chemical compound 1,4-diazabicyclo[2.2.2]octane, used as a catalyst, especially in making polyurethanes\", \"priority\":1}]}, \"synonyms\":{}}");

	add("triethylenetetramine", "{\"term\":\"triethylenetetramine\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An oily liquid used as a crosslinker in epoxy curing and in treating Wilson\u0027s disease\", \"priority\":1}]}, \"synonyms\":{}}");

	add("trifecta", "{\"term\":\"trifecta\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{prefix|tri|lang\u003den}} \u0027perfecta\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A bet in which the bettor must select the first three placegetters of a race in the order in which they finish\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, Vincent Conti, \u0027Thoroughbred Horse Racing Systems and Methodologies\u0027, [http://books.google.com.au/books?id\u003d9cZdKqHeeFEC\u0026amp;pg\u003dPA9\u0026amp;dq\u003d%22trifecta%22%7C%22trifectas%22+-intitle:%22%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003d7QWZUIWVC4memQWG0IDICQ\u0026amp;redir_esc\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22trifecta%22%7C%22trifectas%22%20-intitle%3A%22%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 9\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The conservative player will play the exacta box bet and the occasional \u0027\u0027trifecta\u0027\u0027 box wager\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, Leonard A. Asimow, Mark M. Maxwell, \u0027Probability and Statistics with Applications: A Problem Solving Text\u0027, [http://books.google.com.au/books?id\u003dZL3QQZsp6DAC\u0026amp;pg\u003dPA10\u0026amp;dq\u003d%22trifecta%22%7C%22trifectas%22+-intitle:%22%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003d7QWZUIWVC4memQWG0IDICQ\u0026amp;redir_esc\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22trifecta%22%7C%22trifectas%22%20-intitle%3A%22%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 10\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"In a \u0027\u0027trifecta\u0027\u0027, you must wager on three horses: the one that finishes first (win), the one that finishes second (place), and the one that finishes third (show) in order\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"The attainment of three important achievements, qualities, etc\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A set of three related things, often things that cause problems\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, Michael Morrison, \u0027Head First JavaScript\u0027, [http://books.google.com.au/books?id\u003dxsmBjw814qwC\u0026amp;pg\u003dPA525\u0026amp;dq\u003d%22trifecta%22%7C%22trifectas%22+-intitle:%22%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003d7QWZUIWVC4memQWG0IDICQ\u0026amp;redir_esc\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22trifecta%22%7C%22trifectas%22%20-intitle%3A%22%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 525\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"Along with runtime errors, two other errors we saw earlier round out the JavaScript bug \u0027\u0027trifecta\u0027\u0027: syntax errors, logic errors, and runtime errors\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, Beatriz Scaglia, \u0027[http://books.google.com.au/books?id\u003dii6bZwEACAAJ\u0026amp;dq\u003d%22trifecta%22%7C%22trifectas%22+-intitle:%22%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003d7QWZUIWVC4memQWG0IDICQ\u0026amp;redir_esc\u003dy The \u0027\u0027Trifecta\u0027\u0027 of Evil and the Crisis of Faith: Devil, Satan, and Lucifer\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, Markus Horner, \u0027[http://books.google.com.au/books?id\u003d76q-ZwEACAAJ\u0026amp;dq\u003d%22trifecta%22%7C%22trifectas%22+-intitle:%22%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003d7QWZUIWVC4memQWG0IDICQ\u0026amp;redir_esc\u003dy Consistently Persistent: Living with the Tourette \u0027\u0027Trifecta\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"date\u003d27 November passage\u003dI might never have learned my name or met my birth family if I hadn\u0027t ended up in the hospital in Rhode Island in 2007, after traveling to a \u0027\u0027trifecta\u0027\u0027 of malaria hotspots: Mali, Egypt and Colombia\", \"priority\":15}]}, \"synonyms\":{}}");

	add("trifle", "{\"term\":\"trifle\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\"], \"text\":\"From Middle english (1100-1500) {{m|enm|trufle}}, from Old french (842-ca. 1400) {{m|fro|trufle||mockery}}, from {{m|fro|truffe||deception}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An English dessert made from a mixture of thick custard, fruit, sponge cake, jelly and whipped cream\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An insignificant amount\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Anything that is of little importance or worth\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Shakespear\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Trifles\u0027\u0027 light as air / Are to the jealous confirmation strong / As proofs of holy writ\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Drayto\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"with such poor \u0027\u0027trifles\u0027\u0027 playin\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A particular kind of pewter\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Utensils made from this particular kind of pewter\", \"priority\":9}]}, \"synonyms\":{}}");

	add("trifluoramine", "{\"term\":\"trifluoramine\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"nitrogen trifluoride\", \"priority\":1}]}, \"synonyms\":{}}");

