	add("trigamy", "{\"term\":\"trigamy\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From Greek \u0027τρίγαμος\u0027 from \u0027τρία\u0027 (three) + \u0027γάμος\u0027 (marriage) Or {{confix|tri|gamy|lang\u003den}} in modern terms.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state of having three (legal or illegal) spouses simultaneously\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A third marriage\", \"priority\":2}]}, \"synonyms\":{}}");

	add("trigeneration", "{\"term\":\"trigeneration\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|tri|generation|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The simultaneous production of mechanical power (often converted to electricity), heat, and cooling from a single heat source such as fuel or solar energy\", \"priority\":1}]}, \"synonyms\":{}}");

	add("trigger", "{\"term\":\"trigger\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Dutch\"], \"text\":\"Originally \u0027\u0027 from Dutch \u0027trekker|lang\u003dnl|pos\u003d\u0027noun\u0027, as in \u0026quot;drawer-pull\u0026quot;, \u0026quot;bell-pull\u0026quot;\u0027 () from \u0027trekken\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A finger-operated lever used to fire a gun\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Just pull the \u0027\u0027trigger\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A similar device used to activate any mechanism\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"An event that initiates others, or incites a response\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Sleeping in an unfamiliar room can be a \u0027\u0027trigger\u0027\u0027 for sleepwalking\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"An event, experience or other stimulus that initiates a traumatic memory or action in a person\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A pulse in an electronic circuit that initiates some component\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"An SQL procedure that may be initiated when a record is inserted, updated or deleted; typically used to maintain referential integrity\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A text string that, when received by a player, will cause the player to execute a certain command\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A catch to hold the wheel of a carriage on a declivity\", \"priority\":10}]}, \"synonyms\":{}}");

	add("triglyceride", "{\"term\":\"triglyceride\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From \u0027\u0027 + \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A lipid, an ester of glycerol and three fatty acids (the same or different); the major constituent of animal and vegetable fats\", \"priority\":1}]}, \"synonyms\":{}}");

