	add("trigness", "{\"term\":\"trigness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|trig|ness|lang\u003den}}. See \u0027\u0027 trim, neat.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The quality or state of being trig; smartness; neatness\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Their spars had no man-of-war \u0027\u0027trigness\u0027\u0027.\u0027 \u0026amp;mdash; Kane\", \"priority\":2}]}, \"synonyms\":{}}");

