	add("trikonasana", "{\"term\":\"trikonasana\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Sanskrit\"], \"text\":\"From Sanskrit \u0027त्रिकोणासन\u0027 from \u0027त्रिकोण\u0027 (triangle) + \u0027आसन\u0027 (asana)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A pose in which the legs are kept straight and wide apart, in the shape of a triangle, while the upper body bends\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, \u0027The Guardian\u0027, 14 Jan 2006\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"It is 30 years since I tried yoga, but it mostly came back: \u0027\u0027trikonasana\u0027\u0027, this-asana, that-asana\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, Mel Robin, \u0027A Handbook for Yogasana Teachers\u0027, p. 918\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Because the feet are widely separated left to right in \u0027\u0027trikonasana\u0027\u0027, there is no problem with wobbling or falling in the left-to-right direction […\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2012\u0027\u0027, Leslie Kaminoff \u0026amp; Amy Matthews, \u0027Yoga Anatomy\u0027, p. 40\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Trikonasana\u0027\u0027, or triangle pose, is often referred to as a lateral stretch, and this is true insofar as it lengthens the connective tissue pathway that runs along the side of the body\", \"priority\":7}]}, \"synonyms\":{}}");

