	add("trilogy", "{\"term\":\"trilogy\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"Latin \u0026amp; \u0027trilogia\u0027 from Ancient greek (to 1453) \u0027lang\u003dgrc|τρεῖς\u0027 () + \u0027lang\u003dgrc|λόγος\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A set of three works of art that are connected, and that can be seen either as a single work or as three individual works. They are commonly found in literature, film, or video games\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"22 March 2012\u0027\u0027, Scott Tobias, AV Club \u0027The Hunger Games\u0027[http://www.avclub.com/articles/the-hunger-games,71293\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"That such a safe adaptation could come of The Hunger Games speaks more to the \u0027\u0027trilogy\u0027\u0027’s commercial ascent than the book’s actual content, which is audacious and savvy in its dark calculations\", \"priority\":3}]}, \"synonyms\":{}}");

