	add("tripler", "{\"term\":\"tripler\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|triple|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The simplest form of frequency multiplier, that has an output frequency of three times the value of the input frequency\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, L.K. Maheshwari, M.M.S. Anand, \u0027Analog Electronics\u0027, [https://books.google.hu/books?id\u003d1NcSBP2OA-QC\u0026amp;pg\u003dPA259\u0026amp;dq\u003dtriple\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003dtripler\u0026amp;f\u003dfalse page 259\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A frequency \u0027\u0027tripler\u0027\u0027 can be designed with two multipliers and a summing amplifier without any additional filter by using any one of the following trignometric identities\", \"priority\":4}]}, \"synonyms\":{}}");

