	add("tripodes", "{\"term\":\"tripodes\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From the Latin \u0027tripodēs\u0027 (nominative plural form of \u0027tripūs\u0027 , from the Ancient greek (to 1453) \u0027τρίποδες\u0027 (nominative plural form of \u0027τρίπους\u0027 ; compare \u0027tripus\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"1712\u0027\u0027: w:Joseph Joseph Addison and w:Richard Sir Richard Steele [eds.], \u0027w:The Spectator The Spectator\u0027, volume 5, \u0026lt;span class\u003d\u0026quot;plainlinks\u0026quot;\u0026gt;[http://books.google.co.uk/books?id\u003dRG8PAAAAQAAJ\u0026amp;pg\u003dPA28\u0026amp;dq\u003d%22tripodes%22\u0026amp;lr\u003d\u0026amp;num\u003d100\u0026amp;as_brr\u003d0\u0026amp;ei\u003dqHfgS5mYNoGqNu78uMwK\u0026amp;cd\u003d3\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22tripodes%22\u0026amp;f\u003dfalse page 28]\u0026lt;/span\u0026gt;: № 327 (Saturday, March 15): Joseph Addison, “Criticism on Paradise Lost” (1729 publication\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"THE Poet here ſeems to have regarded two or three Paſſages in the 18th \u0027Iliad\u0027, as that in particular, where, ſpeaking of \u0027Vulcan\u0027, \u0027Homer\u0027 ſays, that he had made twenty \u0027\u0027\u0027Tripodes\u0027\u0027\u0027, running on Golden Wheels; which, upon occaſion, might go of themſelves to the Aſſembly of the Gods, and, when there was no more Uſe for them, return again after the ſame manner\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1963\u0027\u0027: \u0027The Australian University\u0027, volumes 1–2, \u0026lt;span class\u003d\u0026quot;plainlinks\u0026quot;\u0026gt;[http://books.google.co.uk/books?lr\u003d\u0026amp;ei\u003dUX_gS_WUFJTYM7mUwNoK\u0026amp;cd\u003d12\u0026amp;num\u003d100\u0026amp;as_brr\u003d0\u0026amp;id\u003duhoPAQAAIAAJ\u0026amp;dq\u003d%22tripodes%22+University+of+Cambridge+-inauthor%3A%22University+of+Cambridge%22\u0026amp;q\u003d%22tripodes%22 page 193]\u0026lt;/span\u0026gt\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The restriction was deliberate, for the Senate attach[ed]\u0026lt;!-- brackets included in the source --\u0026gt; great importance to high distinction in the classes and \u0027\u0027tripodes\u0027\u0027 of Oxford and Cambridge, from its known influence on the minds of students, and the character which it would impart to out Institution in its period of greatest trial\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1964\u0027\u0027: \u0027Proceedings of the Zoological Society of London\u0027, volume 142, \u0026lt;span class\u003d\u0026quot;plainlinks\u0026quot;\u0026gt;[http://books.google.co.uk/books?id\u003dsesnAQAAIAAJ\u0026amp;q\u003d%22tripodes%22\u0026amp;dq\u003d%22tripodes%22\u0026amp;lr\u003d\u0026amp;num\u003d100\u0026amp;as_brr\u003d0\u0026amp;ei\u003dkkngS6vZHoTulQTwnum-Cw\u0026amp;cd\u003d27 page 431]\u0026lt;/span\u0026gt; (Longmans, Greens\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Expansion of the swimbladder will be accompanied by forward movement of the free edges of the thin areas, and so by forward rotation of the \u0027\u0027tripodes\u0027\u0027. When the swimbladder contracts, the \u0027\u0027tripodes\u0027\u0027 will be rotated backwards by the elastic action of ligament 2\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"1969\u0027\u0027: Harold James Perkin, \u0027Key Profession: The History of the Association of University Teachers\u0027, \u0026lt;span class\u003d\u0026quot;plainlinks\u0026quot;\u0026gt;[http://books.google.co.uk/books?lr\u003d\u0026amp;ei\u003dUX_gS_WUFJTYM7mUwNoK\u0026amp;cd\u003d10\u0026amp;num\u003d100\u0026amp;as_brr\u003d0\u0026amp;id\u003dMc4KAAAAMAAJ\u0026amp;dq\u003d%22tripodes%22+University+of+Cambridge+-inauthor%3A%22University+of+Cambridge%22\u0026amp;q\u003d%22tripodes%22 page 22]\u0026lt;/span\u0026gt; (A. M. Kelley\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Not only was a new race of lecturing and researching professors inaugurated, and new honours courses, such as the Moral Sciences, Natural Sciences, Theological, and Historical \u0027\u0027Tripodes\u0027\u0027 at Cambridge and the serious study of mathematics and science at Oxford, introduced, but a new type of college tutor arose, typified by Oscar Browning at Cambridge and Benjamin Jowett at Oxford, dedicated to preparing their students by strenuous intellectual training not merely for scholarship but for devoted service to society outside the university\", \"priority\":9}]}, \"synonyms\":{}}");

	add("tripoli", "{\"term\":\"tripoli\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Italian\", \"Latin\"], \"text\":\"From Italian \u0027tripoli\u0027 from Latin \u0027tripolis\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The capital city of Libya\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A city in Greec\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A city in Iow\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A city in Lebano\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"An unincorporated community in Wisconsin\", \"priority\":5}]}, \"synonyms\":{}}");

