	add("tripos", "{\"term\":\"tripos\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"Alteration of Latin \u0027tripus\u0027 as though with a Greek ending. For the examination: the word is supposed to refer to the three-legged stool formerly used at the examinations for these honours, though some derive it from the three brackets formerly printed on the back of the paper.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A three-legged structure; a tripod\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"New York Review of Books, 2001, p.73\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Thales sent the golden \u0027\u0027tripos\u0027\u0027, which the fishermen found and the oracle commanded to be “given to the wisest”, to Bias, Bias to Solon, etc\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Any of the final examinations for a BA honours degree at\", \"priority\":4}]}, \"synonyms\":{}}");

