	add("tripus", "{\"term\":\"tripus\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From the Latin \u0027tripūs\u0027 and its etymon the Ancient greek (to 1453) \u0027τρίπους\u0027 compare \u0027tripod\u0027 In the sense associated with Cambridge University, the Tripus is named after the three-legged stool on which he sat during the degree-awarding ceremony.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A Bachelor of Arts appointed to make satirical strictures in humorous dispute with the candidates at a degree-awarding ceremony; tripos, prævaricator\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A vessel (usually a pot or cauldron) resting on three legs, often given as an ornament, a prize, or as an offering at a shrine to a god or oracle; often specifically, that such vessel upon which the priestess sat to deliver her oracles at the shrine to Apollo at Delphi; tripod\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The hindmost Weberian ossicle of the Weberian apparatus, touching the anterior wall of the swimbladder and connected by a dense, elongate ligament to the intercalarium\", \"priority\":3}]}, \"synonyms\":{}}");

