	add("triticale", "{\"term\":\"triticale\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"blend|Blend of Latin {{m|la|trīticum||wheat}} and {{m|la|sēcale||rye}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a grain crop, a hybrid of wheat and rye, that gives a high yiel\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"any particular variety of triticale\", \"priority\":2}]}, \"synonyms\":{}}");

	add("tritocerebrum", "{\"term\":\"tritocerebrum\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|trito|t1\u003dthird|cerebrum|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"lt;!-- \u0026quot;tritocerebrums\u0026quot; appears to appear only in the construction \u0026quot;proto-, deuto- and tritocerebrums,\u0026quot; in which case it is not \u0026quot;tritocerebrum\u0026quot; but \u0026quot;cerebrum\u0026quot; which is being counted. --\u0026gt\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"the third set of fused ganglia composing the insect brain\", \"priority\":2}]}, \"synonyms\":{}}");

