	add("triumphalism", "{\"term\":\"triumphalism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|triumphal|ism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The attitude or belief that a particular doctrine, culture, or social system, particularly a religious or political one, is superior and that it will or should triumph over all others\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1994\u0027\u0027, Michael Howard, \u0026quot;[http://www.foreignaffairs.com/articles/49890/michael-howard/the-world-according-to-henry-from-metternich-to-me?page\u003dshow The World According to Henry: From Metternich to Me],\u0026quot; \u0027w:Foreign Foreign Affairs\u0027, May/June 1994\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"But not only did Soviet \u0027\u0027triumphalism\u0027\u0027 eventually provoke the Reaganite reaction in the United States, but, Kissinger suggests, it produced the overextension of Soviet resources that led directly to economic and ultimately political collapse\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2001\u0027\u0027, Jon Beckwith, \u0026quot;[http://www.americanscientist.org/bookshelf/pub/triumphalism-in-science Triumphalism in Science\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A better understanding of science should lead not to \u0027\u0027triumphalism\u0027\u0027 but to the kind of humility recently expressed by Nobel Prize-winning geneticist Francois Jacob in \u0027Of Flies, Mice and Men\u0027: \u0026quot;Science cannot answer all questions. . . . It can, however, give some indications, exclude certain hypotheses. Engaging in the pursuit of science may help us make fewer mistakes\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2001\u0027\u0027, \u0026quot;[http://www.independent.co.uk/opinion/leading-articles/the-speedy-fall-of-the-taliban-must-not-obscure-the-size-of-the-task-ahead-619435.html The speedy fall of the Taliban must not obscure the size of the task ahead],\u0026quot; \u0027The Independent\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"One reason why \u0027\u0027triumphalism\u0027\u0027 about the fall of the Taliban should be eschewed is because the US and its allies have shown insufficient regret and sadness at the deaths of Afghan villagers. This has allowed the propagandists of Islamic nihilism to claim that the US cares about the deaths of civilians in New York but not in Afghanistan\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, Steven Bayme, \u0026quot;[http://www.ajc.org/site/apps/nlnet/content2.aspx?c\u003dijITI2PHKoG\u0026amp;b\u003d838493\u0026amp;ct\u003d1105683 Orthodox Triumphalism Revisited],\u0026quot; \u0027The Jewish Week\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Yet in addition to being self-defeating, sectarian \u0027\u0027triumphalism\u0027\u0027 undermines core Jewish values of common peoplehood and mutual bonds between Jews worldwide\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, Dr. Michael A. Weinstein, \u0027The Power and Interest News Report\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"The abasement rituals at Abu Ghraib were most generally conditioned by the climate of impunity created by \u0027\u0027triumphalist\u0027\u0027 strategy, ideology and rhetoric, which led, at least, to dismissive negligence and then cover-ups by authorities\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, w:David David Souter, [http://www.law.cornell.edu/supct/html/06-1195.ZC.html concurring opinion], \u0027w:Boumediene v. Boumediene v. Bush\u0027, 553 U.S. ___, ___ (2008\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"The several answers to the charge of \u0027\u0027triumphalism\u0027\u0027 might start with a basic fact of Anglo-American constitutional history: that the power, first of the Crown and now of the Executive Branch of the United States, is necessarily limited by habeas corpus jurisdiction to enquire into the legality of executive detention. And one could explain that in this Court’s exercise of responsibility to preserve habeas corpus something much more significant is involved than pulling and hauling between the judicial and political branches\", \"priority\":13}]}, \"synonyms\":{}}");

