	add("triunity", "{\"term\":\"triunity\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|triune|ity|lang\u003den}}; or from {{prefix|tri|unity|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The fact or state of being three in one (usually with reference to the Christian idea of the Trinity\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1902\u0027\u0027, William James, \u0027The Varieties of Religious Experience\u0027, Folio Society 2008, p. 46\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"God\u0027s attributes as such, his holiness, his justice, his mercy, his absoluteness, his infinity, his omniscience, his \u0027\u0027tri-unity\u0027\u0027 [...] have proved fertile wells of inspiring meditation for Christian believers\", \"priority\":3}]}, \"synonyms\":{}}");

